import React from 'react';
import {Article} from './components';
import {Footer, Header, Blog} from './containers';
import './HomePage.css';

const HomePage = () => (
  <div className="App">
    <div className="gradient__bg">
      <Article />
      <Header />
    </div>
    <Blog />
    <Footer />
  </div>
);

export default HomePage;
